import { Parallax, ParallaxProvider } from "react-scroll-parallax";
import FpLpSections from "../components/FpLpSections";
import LpParallaxSection from "../components/LpParallaxSection";

import LoanProductHero from "../components/LoanProductHero";

export default function LoanProducts() {
  return (
    <>
    <FpLpSections className="d-none d-lg-block d-xl-block"/>
